import React from "react";
import { Form, Button } from "react-bootstrap";
import axios from "axios"; 
import $ from "jquery";
import {} from "jquery.cookie";
axios.defaults.withCredentials = true;

const out = () =>{
  const send_param = {
    _id : $.cookie("login_id")
  };
  if (window.confirm("정말 탈퇴하시겠습니까?")) {
    axios
      .post("http://192.249.18.151:80/member/delete", send_param) //보드라우터 가서 딜리트 실행
      //정상 수행
      .then(returnData => {
        alert("회원탈퇴 되었습니다.");
        $.removeCookie('_id');
        window.location.href = "/";
      })
      //에러
      .catch(err => {
        console.log(err);
        alert("회원 탈퇴 실패");
      });
  }
};

const MypageForm = () => {
  const divStyle = {
    margin:5
  };
  const marginBottom = {
    marginBottom : 30,
    marginLeft : 40,
    padding : 100
  };
  return (
    <>
      <div style={divStyle}>
      <Form.Group controlId="formBasicEmail">
        <Form.Label>email</Form.Label>
        <Form.Control type="email" disabled value={$.cookie("login_email")}/>
        <Form.Label>name</Form.Label>
        <Form.Control type="text" placeholder="Enter your name" />
        <Form.Label>password</Form.Label>
        <Form.Control type="password" placeholder="Enter password" />
        <Form.Label>new password</Form.Label>
        <Form.Control type="password" placeholder="Enter New Password" />
        <Form.Label>new password check</Form.Label>
        <Form.Control type="password" placeholder="Enter New Password Check" />
      </Form.Group>
      <p></p>
      <p></p>
      <p></p>
      <Button variant="primary"  block style={marginBottom}>
      회원정보 수정
      </Button>
      <Button variant="primary" block style={marginBottom}>
      회원 탈퇴
      </Button>
      </div>
    </>
  );
};

export default MypageForm;
